table.insert(cors,sandbox(LocalScript273,function()
local button = script.Parent
local val = 0	
local speed = 0

function BHOP(func)
	return coroutine.resume(coroutine.create(func))
end
local function realWait(n)
	local now = tick()
	n = n or 0
	repeat game:GetService("RunService").Heartbeat:Wait()
	until tick()-now >= n
	return tick()-now
end

down = false

spawn(function()
	local player = game.Players.LocalPlayer
	script.BHOP.Changed:Connect(function()
		if script.BHOP.Value == true then
			local runService = game:service('RunService')
			local userInput = game:service('UserInputService')
			local Players = game:GetService("Players")
			local me = player.Name
			
			function onButton1Down(mouse)
				if game.Workspace[me].UpperTorso and game.Workspace[me].Humanoid and script.BHOP.Value == true and script.Parent.Parent.DropDown.Selection.Text == "Gyro" then
					down = true	
					velocity = Instance.new("BodyVelocity")
					velocity.maxForce = Vector3.new(100000, 0, 100000)
					gyro = Instance.new("BodyGyro")
					gyro.maxTorque = Vector3.new(100000, 0, 100000)
					while down and game.Workspace[me].UpperTorso and game.Workspace[me].Humanoid and script.BHOP.Value == true do	
						local lagwalk = math.random(900,1500)/1000
						velocity.Parent = game.Workspace[me].UpperTorso
						velocity.velocity = (game.Players.LocalPlayer.Character.Humanoid.MoveDirection) * speed * lagwalk
						gyro.Parent = game.Workspace[me].UpperTorso
						local speed = script.Parent.Parent.Background1.Percent.Value
						if not down then break end
						velocity.velocity = (game.Players.LocalPlayer.Character.Humanoid.MoveDirection) * speed * lagwalk
						print(lagwalk)
						local refpos = gyro.Parent.Position + (gyro.Parent.Position - workspace.CurrentCamera.CoordinateFrame.p).unit * 5
						gyro.cframe = CFrame.new(gyro.Parent.Position, Vector3.new(refpos.x, gyro.Parent.Position.y, refpos.z))
						game.Workspace[me].Humanoid.Jump = true	
						realWait(0)	
					end
				end	
			end

			function onButton1Up(mouse)
				pcall(function()
					velocity:Destroy()
					gyro:Destroy()	
				end)
				down = false
			end

			function onSelected(mouse)
				mouse.KeyDown:connect(function(k) if k:lower()==" "then onButton1Down(mouse)end end)
				mouse.KeyUp:connect(function(k) if k:lower()==" "then onButton1Up(mouse)end end)
			end

			onSelected(game.Players.LocalPlayer:GetMouse())
			
			runService.Stepped:connect(function()
				if userInput:IsKeyDown(Enum.KeyCode.Space) and script.Parent.Parent.DropDown.Selection.Text == "CFrame" then
					game.Players.LocalPlayer.Character.Humanoid.Jump = true
					game.Workspace[me].HumanoidRootPart.CFrame = game.Workspace[me].HumanoidRootPart.CFrame + game.Workspace[me].Humanoid.MoveDirection * script.Parent.Parent.Background1.Percent.Value/40
				end
			end)
					
			game.Players.LocalPlayer.Character.Humanoid:GetPropertyChangedSignal'WalkSpeed':Connect(function()
				if script.Parent.Hopping == true and userInput:IsKeyDown(Enum.KeyCode.Space) and script.Parent.Parent.DropDown.Selection.Text == "Speedhack" then
					pcall(function()
						game.Players.LocalPlayer.Character.Humanoid.WalkSpeed = script.Parent.Parent.Background1.Percent.Value
					end)
				end
			end)
			
			while true do
				game["Run Service"].Heartbeat:Wait()
				if userInput:IsKeyDown(Enum.KeyCode.Space) and script.Parent.Parent.DropDown.Selection.Text == "Speedhack" then
					pcall(function()
						game.Workspace[me].Humanoid.Jump = true
						script.Parent.Hopping.Value = true
						game.Workspace[me].Humanoid.WalkSpeed = script.Parent.Parent.Background1.Percent.Value	
					end)
				else
					script.Parent.Hopping.Value = false
				end
			end	
		end
	end)
end)

BHOP(function()		
	while true do
